INSERT INTO `downloads` (`id`, `title`, `file_title`, `file_name`, `file_extension_name`, `descriptions`, `status`, `created_at`, `updated_at`) VALUES
(1,	'Sample File 1',	'Prof-UIS v.3.4.0.9 (54.00Mb)',	'/storage/download/23061470836Audiov.exe',	'.EXE Installer',	'<table cellpadding=\"5\" cellspacing=\"3\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Release versions</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>* Release 3.4.0.9 includes:</strong><br />\r\n			&bull; New feature: Advanced Samples.<br />\r\n			&bull; CacheableGrd &ndash; Example of the implementation of a Cache Grid. The Grid move to new cell areas blazing fast.<br />\r\n			&bull; Word &ndash; Example of a skinable UIS.<br />\r\n			<br />\r\n			<strong>* Solved Problems:</strong><br />\r\n			&bull; Improved speed of rendering for smoother resizing and movement.<br />\r\n			&bull; Fixed problem with interaction with the skin to remove a possible leak warning.<br />\r\n			&bull; Corrected some project setting to remove a variety of warning and errors.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>',	1,	'2023-06-14 07:20:07',	'2023-06-14 01:50:07'),
(2,	'Sample File 2',	'Prof-UIS v.3.4.0.6 (49.00Mb)',	'/storage/download/2306147113223061465032hotel_deal3.zip',	'.ZIP Archive',	'<p>This version (3.4.0.6) includes the following improvements:<br />\r\n1. Added new flag CExtAnimationParameters::g_bAnEnabled (set to false in your application InitInstance to disable animation) to avoid high CPU usage in some applications;<br />\r\n2. Fixed memory leak in CExtTreeCtrl class on InsertItem;<br />\r\n3. CExtGridWnd: while resizing column sizes - rows heights resize at the same size;<br />\r\n4. Close button redesigned;<br />\r\n5. Fixed many compile warnings in various system types;<br />\r\n6. Several build optimization;<br />\r\n7. Update application names for samples</p>',	1,	'2023-06-14 07:20:14',	'2023-06-14 01:50:14');
