INSERT INTO `pages` (`id`, `title`, `image`, `descriptions`, `slug`, `meta_title`, `meta_keyword`, `meta_description`, `status`, `created_at`, `updated_at`) VALUES
(2,	'Graphical user interface tool and libraries',	'/storage/page/2306147494005.jpg',	'<p>FOSS Software, Inc. is a software development and consulting company located in Salem, New Hampshire. It was founded in November of 2000 by a group of highly qualified programmers and program managers with extensive experience in software design and development.</p>\r\n\r\n<p>Professional UI Solutions is a divison of FOSS Software. We specialize in developing graphical user interface tools and libraries for Windows developers and providing custom software development and consulting services. We have three major priorities:</p>\r\n\r\n<ul>\r\n	<li>Great Software Products and Solutions.</li>\r\n	<li>Fair Pricing.</li>\r\n	<li>Excellent Technical Support.</li>\r\n</ul>\r\n\r\n<p>The user interface is rapidly evolving and getting more efficient and user-friendly. We are committed to leverage all the benefits of modern interface features and bring the best tools and solutions to our customers.</p>',	'graphical-user-interface-tool-and-libraries',	NULL,	NULL,	NULL,	1,	'2023-01-31 05:37:58',	'2023-06-14 02:20:39'),
(3,	'Prof-UIS',	NULL,	'<h3>Overview</h3>\r\n\r\n<p>Prof-UIS is designed to help Visual C++ programmers save hundreds of hours in implementing today&#39;s most demanded GUI facilities in their applications. It is an extensible, object-oriented framework that allows you to easily customize and extend its functionality. That, combined with our striving to keep abreast of the latest UI trends, ensures our customers get the most innovative up-to-date graphical user interface that fits their needs.</p>\r\n\r\n<h3>Feature List</h3>\r\n\r\n<table border=\"0\" cellpadding=\"6\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Prof-UIS</td>\r\n			<td>Full</td>\r\n			<td>Free</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">Theme Support</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Popular UI themes changeable on the fly.</td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_gui_themes.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_gui_themes.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Microsoft Office 2010 Blue theme.</td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_theme_office_2010_blue.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_theme_office_2010_blue.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Microsoft Office 2010 Black theme.</td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_theme_office_2010_black.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px;