rc=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Command manager, which stores all the information about commands used in toolbars and menus like text, icon, tooltip text, and more.</td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_command_manager.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_command_manager.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Resource manager, which allows you to switch between languages supported in Prof-UIS and/or your application on the fly.</td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_resource_manager.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_resource_manager.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Nine paint manager classes for implementing the themes available in Prof-UIS. Each paint manager draws all UI components in a consistent way.</td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_paint_manager.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_paint_manager.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Multiple monitor support, which allows you to use two or more monitors simultaneously, with each of them being part of your desktop.</td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_multi_monitor.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_multi_monitor.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>GUI persistence. The default implementation serializes the user interface components to the Windows registry but you can also serialize data to use a file on dick.</td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_gui_persistence.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_gui_persistence.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Full screen mode for MDI/SDI applications.</td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_full_screen_mode.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_full_screen_mode.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>A set of generalized template window classes for automating various common tasks including flicker-free painting, providing a thin border around a control, theme consistency, and more.</td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_template_classes.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_template_classes.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Supported operating systems include:</p>\r\n\r\n			<ul>\r\n				<li>32-bit Windows 95/98/98SE/ME</li>\r\n				<li>32-bit Windows NT/2000/XP/2003</li>\r\n				<li>32-bit Windows Vista</li>\r\n				<li>32-bit Windows 7</li>\r\n				<li>64-bit Windows XP/2003</li>\r\n				<li>64-bit Windows Vista</li>\r\n				<li>64-bit Windows 7</li>\r\n			</ul>\r\n			</td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_supported_OSes.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_template_classes.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Localized to 39 languages including Arabic, Armenian, Belarusian, Bosnian, Brazilian Portuguese, Bulgarian, Canadian French, Chinese Simplified, Chinese Traditional, Croatian, Czech, Danish, Dutch, Estonian, Farsi, French, German, Greek, Hungarian, Indonesian, Italian, Japanese, Khmer, Korean, Latvian, Lithuanian, Macedonian, Norwegian, Polish, Romanian, Russian, Serbian, Slovak, Slovenian, Spanish, Swedish, Turkish, Ukrainian, and Vietnamese.</td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_supported_languages.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_supported_languages.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Right-To-Left (RTL) support for languages like Arabic and Hebrew.</td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_rtl_support.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_rtl_support.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Support for ANSI, MBCS, and UNICODE.</td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_character_systems.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_character_systems.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>The library is designed to be used in in EXE, DLL, and ActiveX projects.</td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_build_configurations.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n			<td><a href=\"https://www.prof-uis.com/prof-uis/feature-tour/tour_build_configurations.aspx\"><img alt=\"¬ª\" src=\"https://www.prof-uis.com/img/c/yes02.gif\" style=\"height:16px; width:16px\" /></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>',	'prof-uis',	NULL,	NULL,	NULL,	1,	'2023-06-14 12:49:22',	'2023-06-14 12:52:18'),
(4,	'Elegant Ribbon',	NULL,	'<h3>.NET WinForms Controls</h3>\r\n\r\n<p>Elegant Ribbon is a suite of Windows Forms controls that allows you quickly and easily provide your application with a ribbon user interface like in Microsoft Office 2013/2010/2007. It is written in 100% managed C# and is CLS compliant.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>100% compliance with Microsoft Ribbon Guidelines</li>\r\n	<li>Very close or exact match to Microsoft Office Ribbon</li>\r\n	<li>Intuitive and easy to develop with Visual Studio 2012/2010/2008</li>\r\n	<li>Themes: Office 2013, Office 2010, Office 2007, Windows 7 and System</li>\r\n	<li>Fast and responsive user interface</li>\r\n	<li>Windows 2000 to Windows 8 support</li>\r\n	<li>Free trial</li>\r\n</ul>',	'elegant-ribbon',	NULL,	NULL,	NULL,	1,	'2023-06-14 12:56:19',	'2023-06-14 12:58:52'),
(5,	'Elegant Grid',	NULL,	'<p>The Elegant Grid is a set of feature-rich and extensible .NET components designed to help developers easily create the presentation layer of table and hierarchical data for professional Windows Forms applications. All components are written in 100% managed C# and are CLS compliant.</p>\r\n\r\n<p>The grid architecture is designed to be conceptually compatible with all the Windows Forms elements including&nbsp;<code>DataGridView</code>. This allows you to use your existing skills and knowledge when developing with the Elegant Grid.</p>\r\n\r\n<h3>Key Features</h3>\r\n\r\n<pre>\r\n<strong>Data Bound Grid</strong></pre>\r\n\r\n<ul>\r\n	<li>The Elegant Grid provides full support for data binding to objects of different types, including instances of standard types such as&nbsp;<code>DataSet</code>,&nbsp;<code>DataTable</code>,&nbsp;<code>DataView</code>,&nbsp;<code>IList</code>, and&nbsp;<code>IBindingList</code>.</li>\r\n	<li>Flexible column mapping allows you to display data from a table different from the primary table bound to the grid, which is especially useful when you are working with tables linked by relations and want to display meaningful values instead of IDs.</li>\r\n	<li>Smart memory management, when only visible cell and row objects are instantiated using a memory pool for fast allocation/deallocation, dramatically reduces grid creation time and memory usage overhead.</li>\r\n	<li>Mixed bound and unbound data in one grid.</li>\r\n	<li>Data binding to jagged arrays.</li>\r\n</ul>\r\n\r\n<pre>\r\n<strong>Unbound Grid</strong></pre>\r\n\r\n<ul>\r\n	<li>You can work with grid objects without binding to any data source. In this case, you have absolute control over the grid&#39;s contents by adding, removing, and modifying rows, cells and other grid elements.</li>\r\n	<li>Built-in tree grid-like functionality with nested group rows and data rows allows you to group and display data in a logical and structured way.</li>\r\n	<li>Support for adding rows to group rows on-the-fly.</li>\r\n</ul>\r\n\r\n<pre>\r\n<strong>Virtual Grid</strong></pre>\r\n\r\n<ul>\r\n	<li>Ideal solution when you need to present data from a data source of huge size, for example, when you have millions of records in your data table.</li>\r\n</ul>\r\n\r\n<pre>\r\n<strong>Data Sorting and Grouping</strong></pre>\r\n\r\n<ul>\r\n	<li>The bound grid supports multiple criteria sorting and grouping.</li>\r\n	<li>You can additionally show a Microsoft Outlook-like&nbsp;<strong>Group by Box</strong>&nbsp;to enable the end user to perform grouping by drag-and-dropping items.</li>\r\n	<li>Sorting and grouping by cell display values is supported.</li>\r\n	<li>You can define your custom comparison criterion by using a particular event.</li>\r\n</ul>\r\n\r\n<pre>\r\n<strong>Data Visualization and Editing</strong></pre>\r\n\r\n<ul>\r\n	<li>The following cell types are available for displaying and editing data: text, numeric, date/time, image, combo box, check box, color, and progress bar.</li>\r\n	<li>Each cell supports an image and two buttons (ellipsis, check box, or drop-down) embedded in the left and/or right side of the cell contents.</li>\r\n	<li>You can easily customize the look and feel of every particular visual element of a cell using a set of cell styles and events.</li>\r\n	<li>When editing, data validation is supported, which allows you to subscribe to validation events and implement complete control over the data entry process.</li>\r\n	<li>Alternatively, any of Windows Forms controls can be used as a data editor.</li>\r\n	<li>Tooltip support for cells whose text does not fit inside the cell area.</li>\r\n</ul>\r\n\r\n<pre>\r\n<strong>Column and Row Layout</strong></pre>\r\n\r\n<ul>\r\n	<li>Both column headers and row headers are supported.</li>\r\n	<li>The end user can resize, reorder, or hide columns by using drag-and-drop or you can control their width, position and visibility programmatically.</li>\r\n	<li>The row height is determined automatically by measuring the contents. You can also make the row height of a fixed size independently of the actual contents or implement your custom measuring logic.</li>\r\n	<li>Three types of left indent are supported: indent for all the rows, indent for data rows relative to their group row, and indent for group rows relative to their parent row.</li>\r\n</ul>\r\n\r\n<pre>\r\n<strong>Scrolling, Focus and Selection</strong></pre>\r\n\r\n<ul>\r\n	<li>Full control over row selection.</li>\r\n	<li>Handy ways of controlling a vertical/horizontal scroll position in bound and unbound mode.</li>\r\n	<li>Handy ways of controlling the focused item and how the focused item looks.</li>\r\n	<li>Easy-to-use multiple selection in your code.</li>\r\n</ul>\r\n\r\n<pre>\r\n<strong>Controlling Appearance</strong></pre>\r\n\r\n<ul>\r\n	<li>You can finely customize the way any cell looks and acts using the multi-level cell style mechanism. A variety of style properties can be tweaked at the grid level, at the column/row level, and at the cell level. Final style property values are calculated with inheritance rules.</li>\r\n	<li>The Elegant Grid provides support for drawing each visual element using Windows theme support libraries, which allows the end-user to freely apply any third-party themes and theme tweakers.</li>\r\n	<li>Each color filled area can be drawn with a custom graphic texture glyph.</li>\r\n	<li>Appearance settings for a particular grid instance can be saved to a skin file and then loaded to any other grid instance.</li>\r\n	<li>Built-in skins include:\r\n	<ul>\r\n		<li>Office 2013 AzureWhite</li>\r\n		<li>Office 2013 AzureLightGrey</li>\r\n		<li>Office 2013 AzureDarkGrey</li>\r\n		<li>Office 2013 GreenWhite</li>\r\n		<li>Office 2013 GreenLightGrey</li>\r\n		<li>Office 2013 GreenDarkGrey</li>\r\n		<li>Office 2013 OrangeWhite</li>\r\n		<li>Office 2013 OrangeLightGrey</li>\r\n		<li>Office 2013 OrangeDarkGrey</li>\r\n		<li>Office 2013 RedWhite</li>\r\n		<li>Office 2013 RedLightGrey</li>\r\n		<li>Office 2013 RedDarkGrey</li>\r\n		<li>Office 2010 Blue</li>\r\n		<li>Office 2010 Silver</li>\r\n		<li>Office 2010 Black</li>\r\n		<li>Windows 7</li>\r\n		<li>Office 2010 TP</li>\r\n		<li>Office 2007 Blue</li>\r\n		<li>Office 2007 Black</li>\r\n		<li>Office 2007 Silver</li>\r\n		<li>System</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<pre>\r\n<strong>Exporting Data</strong></pre>\r\n\r\n<ul>\r\n	<li>Handy methods for exporting data from the bound, unbound and virtual grid to a file or a stream in the following formats:\r\n	<ul>\r\n		<li>Tab-delimited text</li>\r\n		<li>HTML table</li>\r\n		<li>Microsoft Excel XML workbook</li>\r\n	</ul>\r\n	</li>\r\n	<li>Exported data can be limited by excluding column header cells, hidden columns, and collapsed rows and by exporting only a range of rows.</li>\r\n</ul>\r\n\r\n<pre>\r\n<strong>Miscellaneous</strong></pre>\r\n\r\n<ul>\r\n	<li>The full design-time support in the Windows Forms Designer allows you to tune up the grid in a convenient and well known way.</li>\r\n	<li>Each class is designed to allow you to easily extend the existing features both by subscribing to events and by inheriting from the classes implementing the Elegant Grid object model.</li>\r\n	<li>The&nbsp;<strong>Allow Unsafe Code Blocks</strong>&nbsp;option is always set to false for the grid code, which allows the host application to be run with minimum security permissions.</li>\r\n</ul>',	'elegant-grid',	NULL,	NULL,	NULL,	1,	'2023-06-14 13:01:40',	'2023-06-14 13:04:06'),
(6,	'Frame Features',	NULL,	'<h3>Overview</h3>\r\n\r\n<p>Prof-UIS Frame Features is a powerful ActiveX control that is based on Prof-UIS and allows you to easily provide your applications with rich and up-to-date graphical user interfaces similar to those used in Microsoft Office XP/2003 and Visual Studio 2005.</p>\r\n\r\n<p>Frame Features can be used in most of the form designers supporting the ActiveX container technology including</p>\r\n\r\n<ul>\r\n	<li>Visual Basic 6.0</li>\r\n	<li>Visual Java++ 6.0</li>\r\n	<li>Visual Basic 7.0/7.1</li>\r\n	<li>C# 7.0/7.1/8.0</li>\r\n	<li>J# 7.1/8.0</li>\r\n	<li>Internet Explorer (HTA)</li>\r\n</ul>\r\n\r\n<p>It can also be used in any other environment that provides access to a handle of the window in which the dockable windows supported by Frame Features should be displayed.</p>\r\n\r\n<pre>\r\n<strong>Key Features:</strong></pre>\r\n\r\n<ul>\r\n	<li>Microsoft Visual Studio 2005 and Office 2000/XP/2003 themes changeable on-the-fly</li>\r\n	<li>Dockable menu bar with automatic support for the list of open MDI windows</li>\r\n	<li>Dockable toolbars</li>\r\n	<li>Fully customizable toolbars, menus, and keyboard accelerators</li>\r\n	<li>MDI tabs</li>\r\n	<li>MDI windows dialog</li>\r\n	<li>System menu for the MDI/SDI main frame and MDI child frame window</li>\r\n	<li>Context menu for the menu bar and toolbars</li>\r\n	<li>Consistent resizable combo/edit fields in toolbars and menus</li>\r\n	<li>Scroll bars/sliders and drop-down buttons in toolbars and menus</li>\r\n	<li>Color pop-up menus</li>\r\n	<li>Menu features: shadows, animation, frequently/rarely used commands, and tooltip window like in Windows 2000</li>\r\n	<li>Enhanced status bar control</li>\r\n	<li>Full-screen mode support</li>\r\n	<li>User interface persistence to the system registry or to a file</li>\r\n	<li>Context-sensitive help</li>\r\n	<li>Multiple monitor support</li>\r\n	<li>MBSC and Unicode versions</li>\r\n	<li>Localized to 39 languages including Arabic, Armenian, Belarusian, Bosnian, Brazilian Portuguese, Canadian French, Chinese Simplified, Chinese Traditional, Czech, Danish, Dutch, Estonian, Farsi, French, German, Greek, Hungarian, Indonesian, Italian, Japanese, Khmer, Korean, Latvian, Lithuanian, Macedonian, Norwegian, Polish, Romanian, Russian, Serbian, Slovak, Slovenian, Spanish, Swedish, Turkish, Ukrainian, and Vietnamese</li>\r\n	<li>Complete control over the implemented features both at design and runtime</li>\r\n</ul>',	'frame-features',	NULL,	NULL,	NULL,	1,	'2023-06-14 13:02:46',	'2023-06-14 13:02:46');
