INSERT INTO `testimonials` (`id`, `name`, `designation`, `image`, `message`, `rating`, `status`, `created_at`, `updated_at`) VALUES
(1,	'Chris Herrington',	'CSS, Inc, USA',	NULL,	'Have I mentioned how awesome your product [Elegant Ribbon] is lately? I know I can be critical at times but I want you guys to know without your control my product would be nothing. There are still a few things that I need but your product is fantastic. My product could not look any better than it does. I will be sending you guys a beta of my software in a few weeks. You might use it because it is for developers. Once it is finished I will give you guys a few license keys for your use. I really appreciate you guys and the changes you have made for me',	NULL,	'1',	'2023-06-14 05:50:33',	'2023-06-14 05:50:33'),
(2,	'Roland Ehlert',	'Maxcrc GmbH, Germany',	NULL,	'Prof-UIS is an excellent professional software library that let‚Äôs the developer have the focus on the functionality rather the user interface. In combination with the perfect technical support it is unbeatable. If you ever want to sell your software product Prof-UIS library is a must. I‚Äôm looking forward to the next version of this outstanding software.',	NULL,	'1',	'2023-06-14 05:52:27',	'2023-06-14 05:52:27');
